import './searchitem.css'

export default function SearchItem(props) {
    function changeText(){
        if(props.language==="PORT"){
            props.option==="Busca"?"Busca":"Catalogação";
        }else{
            props.option==="Search"?"Search":"Cataloging";
        }    
    }

    return (
        <div onClick={() => props.clickHandler()}>
            {changeText()}
        </div>
    );
}
